import Navigation from '../Navigation/Navigation';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <div className="header__logo"></div>
      <div className="header__navigation">
        <Navigation />
      </div>
    </header>
  )
};

export default Header;
